" title="SESAR"><img class="linkIcon" src="images/sesar-logo.jpg" alt="SESAR"><\/a><\/div>',qvg='<div style="height:1px;width:1px;"><\/div>',f4g='<h1>Welcome to MetPetDB<\/h1> <p><strong>MetPetDB<\/strong> is a database for metamorphic petrology that is being designed and built by a global community of metamorphic petrologists in collaboration with computer scientists at Rensselaer Polytechnic Institute as part of the National Cyberinfrastructure Initiative and supported by the National Science Foundation.<\/p><p>This project will support the development, implementation and population of MetPetDB with the purpose of:<\/p><ol><li><span>archiving published data,<\/span><\/li><li><span>storing new data for ready access to researchers and students,<\/span><\/li><li><span>facilitating the gathering of information for researchers beginning new projects,<\/span><\/li><li><span>providing a search mechanism for data relating to anywhere on the globe,<\/span><\/li><li><span>providing a platform for collaborative studies among researchers, and<\/span><\/li><li><span>serving as a portal for students beginning their studies of metamorphic geology.<\/span><\/li><\/ol><p>Read more about the MetPetDB project <a href="http://wiki.cs.rpi.edu/trac/metpetdb" title="More about MetPetDB">here<\/a>.<\/p>',Tah='<h2>',X3g='<html',SBg="<iframe src=\"javascript:''\" name='",k4g='<img class="image-slices" src="images/slices.jpg">',p4g='<img src="images/iphone-sample.png" style = "margin:5px" alt="" class="r"><div style = "width:50%"><h1> iPhone App Released! <\/h1> <p> Download it <a href="http://appshopper.com/link/metpetdb" title="Download MetPetDB">here<\/a>.<\/p><p> The MetPetDB iPhone app is an application for students, teachers, and researchers interested in Geosciences, especially Metamorphic Petrology. It is meant to provide tools needed for field work in Earth Sciences.<\/p><p> It provides access to information contained in the MetPetDB system which contains information about rock samples, subsamples, images, and chemical analyses. Users can search for samples close to their location, at a specific latitude and longitude, or any specifically named geographic location. In addition, searches can be further refined by rock type, metamorphic grade, sample owner and minerals available in the sample. For each sample, users can view all the relevant data available in the database.<\/p><p> <a href="http://wiki.cs.rpi.edu/trac/metpetdb/wiki/IphoneApp" title="More about iPhone app">Learn More<\/a>.<\/p><\/div>',bCg="<img src='",Nvg="<input name='%NAME%' type='radio'/>",Lvg="<input type='checkbox'/>",m2g='<span class="cell">',O1g='<span class="cell-contents">Cell Contents: ',N1g='<span class="error-message">',gbh='<span class="igsn">IGSN<\/span> ',ieh='<span id="clear-link"><\/span>',i0g='<span id="page-category" class="hide"><\/span><span id="page-title" class="hide"><\/span><span id="page-desc" class="hide"><\/span><span id="page-actions" class="hide"><\/span>',E9g='<span>',w0g='<span>Search for:<\/span> <span id="radio-samples"><\/span><span id="radio-analyses"><\/span>',sbh='<strong>',Qeh='<sub>',Z7g='<sub>$1<\/sub>',Bdh='<svg',P0g='<table class="info" cellspacing="0"><tbody>',Q7g='<table>',Yvg='<table><tbody>',Ovg='<td',Vvg="<td align='CENTER'>",Xvg='<tr',R7g='<tr class=\\"" + CSS.TYPE_SMALL_CAPS\n\t\t\t\t\t+ "\\"><th>ppm<\/th><th>Element<\/th><\/tr>',U7g='<tr class=\\"" + CSS.TYPE_SMALL_CAPS\n\t\t\t\t\t+ "\\"><th>wt%<\/th><th>Element<\/th><\/tr>',Y7g='<tr class=\\""+ CSS.TYPE_SMALL_CAPS +"\\"><th>ppm<\/th><th>Oxide<\/th><\/tr>',$7g='<tr class=\\""+ CSS.TYPE_SMALL_CAPS +"\\"><th>wt%<\/th><th>Oxide<\/th><\/tr>',S7g='<tr><td class="ppm">',V7g='<tr><td class="wt">',Q0g='<tr><th>',j9g='<tr><th>First Author:<\/th><td>',l9g='<tr><th>Full Citation:<\/th><td>',i9g='<tr><th>Journal:<\/th><td>',k9g='<tr><th>Second Authors:<\/th><td>',h9g='<tr><th>Title:<\/th><td>',Cah='<ul>\n<li>Specify Location by:<\/li>\n<li><span id="region"><\/span><\/li>\n<li><span id="coo
